$.fn.inliner=function(e){console.log("inline function");var n=$(this),t=$(this).find("style");$(t).each(function(e,t){var i=$(t)[0].sheet.cssRules;$(i).each((e,t)=>{$(n).find(t.selectorText).each((e,n)=>{$(t.style).each(function(e,i){$(n)[0].style[i]=t.style[i]})})})}),$(this).find("style").remove()};